In JavaScript, you can perform case-sensitive sorting using the `Array.prototype.sort()` method along with a custom comparator function. The default behavior of `sort()` is to convert elements to strings and compare them in Unicode code point order, which is case-sensitive. However, if you want to ensure case-sensitive sorting explicitly, you can define a comparator function that compares strings based on their Unicode values.

Here's an example of how to perform case-sensitive sorting on an array of strings:

```javascript
const array = ['banana', 'Apple', 'cherry', 'date', 'Blueberry'];

array.sort((a, b) => {
  if (a < b) {
    return -1;
  }
  if (a > b) {
    return 1;
  }
  return 0;
});

console.log(array);
```

In this example, the `sort()` method is called with a comparator function that compares two strings `a` and `b`. The function returns:

- `-1` if `a` should come before `b`
- `1` if `a` should come after `b`
- `0` if `a` and `b` are considered equal

This will result in a case-sensitive sorted array:

```javascript
[ 'Apple', 'Blueberry', 'banana', 'cherry', 'date' ]
```

